function PasswordSettings () {


    return(
        <div>
            
            <div className="label">
                <label>Change password:</label>   
            </div>
            
            <div className="label-input">

                <input type="text" className="password-text-style" placeholder="change password..." />

                <button className="password-change-btn" onClick={change}>change</button>
            </div>

            
            
        </div>
    )
}

export default PasswordSettings;
